import { Route, Navigate } from "react-router-dom";
import { useSelector } from "react-redux";


const PrivateRoute = ({ children }) => {   //access auth from state   const { auth } = useSelector((state) => ({ ...state }));   
     console.log(auth.userState);
return auth && auth.userState && auth.userState.token ? (     children   ) : (     <Navigate to='/login' />   ); };

export default PrivateRoute;
